fragment ProductsEditProduct on ProductNode {
  id
  name
  description
  category
  price
  count
  isAddNutritionalValue
  proteins
  greases
  carbs
  energyValue
  weight
  image
  __typename
}
query test2($where: ProductNodeWhereInput) {
  products2(where: $where, orderBy: {createdAt: DESC}) {
    pageInfo {
      endCursor
      hasNextPage
      hasPreviousPage
      startCursor
      __typename
    }
    edges {
      node {
        ...ProductsEditProduct
        __typename
      }
      cursor
      __typename
    }
    __typename
  }
}

