fragment AuthUser on UserNode {
  id
  email
  isActivated
  role
  __typename
}
mutation AuthLogIn($loginUserInput: LoginUserInput!) {
  result: login(loginUserInput: $loginUserInput) {
    user {
      ...AuthUser
      __typename
    }
    tokens {
      accessToken
      refreshToken
      __typename
    }
    __typename
  }
}

